import axios from 'axios';
import authHeader from './auth-header';

const CREATE_URL = 'http://localhost:8080/api/coach/create/';

class CoachService {

    addCoach(name) {
        return axios.post(CREATE_URL, {name}, {headers: authHeader()});
    }

}
export default new CoachService();
